const originalWarn = console.warn;

export const suppressWarnings = () => {
  console.warn = (...args) => {
    // Convert args to string for easier matching
    const warningMessage = String(args[0] || '');

    // Skip specific React Native Web warnings
    const warningsToSuppress = [
      '"shadow*" style props are deprecated. Use "boxShadow".',
      'props.pointerEvents is deprecated. Use style.pointerEvents',
      // Add any other warnings to suppress here
    ];

    // In development, log warnings we're trying to suppress for debugging
    if (process.env.NODE_ENV === 'development' && 
        warningMessage.includes('deprecated')) {
      console.log('Warning received:', warningMessage);
    }

    const shouldSuppress = warningsToSuppress.some(warning => 
      warningMessage === warning
    );

    if (!shouldSuppress) {
      originalWarn.apply(console, args);
    }
  };
};

export const restoreWarnings = () => {
  console.warn = originalWarn;
};
